    "/api/blogs/15": {"data":{"id":15,"attributes":{"Title":"My Project Madness","Body":"{\"time\":1673912137049,\"blocks\":[{\"id\":\"eV0cm-v0uz\",\"type\":\"list\",\"data\":{\"style\":\"ordered\",\"items\":[\"sk8ermike.js - js framework&nbsp;\",\"Tiny Devs - Youth JS/Unity Lesson Plan / Community\",\"&nbsp;Smalle - templating&nbsp;\",\"Swell - dynamic water rendering (pipeline agnostic)&nbsp;\",\"Readme - documentation for unity&nbsp;\",\"Slide Ride - linerider inspired mobile game&nbsp;\",\"Frank from Earth - Robotron inspired roguelike with couch coop and area pvp&nbsp;\",\"Greenshot - Better unity prefabs&nbsp;\",\"Weaponized Walkie Talkies - 2v2 Arena fighter&nbsp;\",\"Battle Meow - Water dog fights&nbsp;\",\"Rocket Balls - FPS Sports&nbsp;\",\"Sprite City - Game jam template, Hello world for game dev&nbsp;\",\"Fluid Motion - Real time animation editing powered by Bezier curves&nbsp;\",\"Musical Blobeauty - Audio render platformer experiment&nbsp;\",\"Game of Inches - Mobile football game&nbsp;\",\"Project Manhole - Robotron inspired arcade game\"]}}],\"version\":\"2.23.2\"}","createdAt":"2023-01-16T23:26:07.530Z","updatedAt":"2023-01-16T23:35:54.437Z","publishedAt":"2023-01-16T23:26:09.965Z"}},"meta":{}},
